import React from 'react';


const Icons = () =>{
    return
      <div className = "icon">
                    <span><a href="http://facebook.com/"><i class="fa fa-facebook"></i></a></span>
                    <span><a href="http://linkedin.com/"><i class="fa fa-linkedin"></i></a></span>
                    <span><a href="http://twitter.com/"><i class="fa fa-twitter"></i></a></span>
                    <span><a href="http://plus.google.com/"><i class="fa fa-google-plus"></i> </a></span>

    </div>
}

export default Icons;
